  false,\n\t\"url\": null,\n\t\"notes\": \"This metric tracks the number of congregate
  and home delivered meals provided to seniors per month. DFSS, Senior Services division
  is the cityu2019s Area Agency on Aging for older adults. DFSS offers a wide variety
  of programs and services that address the diverse needs and interests of older adults
  in Chicago from those who are healthy and active to those who are frail and homebound.
  \ The Congregate Dining Program strengthens social relationships while addressing
  the problem of poor nutrition among older adults. Each day Senior Services provides
  seniors with opportunities for nutritious meals, socialization, recreation, education
  and volunteer activities through approximately 60 co-sponsored congregate dining
  sites which annually serve over 20,000 senior residents. DFSS also provides over
  11,000 frail homebound older adults with hot home delivered meals five days a week.\",\n\t\"license_title\":
